import React, { useEffect, useState } from 'react';
import Review from "./Review";

const Home = () => {
    const [reviews, setReviews] = useState(null);


    // useEffect(() => {
    //     fetch('https://script.google.com/macros/s/AKfycbzAk3DWTrYtZwCKKtrGhAtc1Au70cV_bxIoTMv8JbK_mv6lFH1ZUPPcJymtE6F8KjJF/exec')
    //         .then(response => {
    //             if (!response.ok) {
    //                 throw new Error('Network response was not ok');
    //             }
    //             return response.json();
    //         })
    //         .then(data => setData(data.data))
    //         .catch(error => {
    //             console.error('Error fetching data:', error);
    //         });
    // }, []);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbzAk3DWTrYtZwCKKtrGhAtc1Au70cV_bxIoTMv8JbK_mv6lFH1ZUPPcJymtE6F8KjJF/exec')
            .then(res => {
                return res.json();
            })
            .then(data => setReviews(data))
    }, []);

    console.log(reviews);

    return (
        <div className="home">
            <div className="section">
                <h1>Top Reviews</h1>
                <div className="gallery">
                    {reviews && (<Review thing={reviews[0]} key="0" />)}
                </div>
            </div>
            <hr />
        </div>
    );
}

export default Home;
